import React from "react";
import Iframe from "react-iframe";
export default function Contact() {
	return (
		<>
			<h1 className="Contact"> Contact</h1>
			<div>
				<Iframe
					src="//www.googletagmanager.com/ns.html?id=GTM-NXDPGM"
					height="0"
					width="0"
				></Iframe>
			</div>
		</>
	);
}
